import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import MoviePage from './components/MoviePage';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Loginsignup />} />
        <Route path="/movies" element={<MoviePage />} />
      </Routes>
    </Router>
  );
};

export default App;
